pub struct Config {
    pub male_names: Vec<String>,
    pub female_names: Vec<String>,
}

impl Default for Config {
    fn default() -> Self {
        Config {
            male_names: get_male_names(),
            female_names: get_female_names(),
        }
    }
}

pub fn get_config() -> Config {
    let cfg: Config = confy::load("hurriname").unwrap();
    cfg
}
